import { useNavigate } from 'react-router-dom';

function Home() {
  const navigate = useNavigate();

  return (
    <div className="container">
      <nav className="navbar">
        <h1>AquaSmart</h1>
        <div>
          <a href="#">Login</a>
          <a href="#">Register</a>
        </div>
      </nav>

      <h2>Welcome to AquaSmart</h2>
      <div className="home-sections">
        <div onClick={() => navigate('/sensordata')}>Sensor Data</div>
        <div onClick={() => navigate('/weather')}>Weather Forecast</div>
        <div onClick={() => navigate('/control')}>Irrigation Control</div>
      </div>
    </div>
  );
}

export default Home;
